import React, { useState } from 'react';
import './Chat.css';
import constantData from './constantData'; // Update the import path
const { row1Data1, row2Data1, row1Data2, row2Data2} = constantData();

function Chat() {

  const [currentRows, setCurrentRows] = useState(['row1', 'row2']);

  const handleDisplayRow12 = () => {
    setCurrentRows(['row1', 'row2']);
  };

  const handleDisplayRow34 = () => {
    setCurrentRows(['row3', 'row4']);
  };

  let rowData = [];

  currentRows.forEach((row) => {
    if (row === 'row1') {
      rowData = rowData.concat(row1Data);
    } else if (row === 'row2') {
      rowData = rowData.concat(row2Data);
    } else if (row === 'row3') {
      rowData = rowData.concat(row3Data);
    } else if (row === 'row4') {
      rowData = rowData.concat(row4Data);
    }
  });


  return (
    <div>
      <link rel="stylesheet" href="https://www.w3schools.com/w3css/4/w3.css" />
      <div className='conv-container'>
      </div>
      <div className='conv-analysis'>
        <table>
          <tbody>
            <tr>
              {row1Data1.map((item, index) => (
                <td key={index}>
                  <span>{item.text}</span>
                  <div className={`w3-light-grey w3-round-xlarge ${item.color}`}>
                    <div className={`w3-container ${item.color} w3-round-xlarge`} style={{ width: item.percentage }}>{item.percentage}</div>
                  </div>
                </td>
              ))}
            </tr>
            <tr>
              {row2Data1.map((item, index) => (
                <td key={index}>
                  <span>{item.text}</span>
                  <div className={`w3-light-grey w3-round-xlarge ${item.color}`}>
                    <div className={`w3-container ${item.color} w3-round-xlarge`} style={{ width: item.percentage }}>{item.percentage}</div>
                  </div>
                </td>
              ))}
            </tr>
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Chat;
